area: json["area"],  );  Map<String, dynamic> toJson() => {    "range": List<dynamic>.from(range!.map((x) => x)),    "country": country,    "region": region,    "eu": eu,    "timezone": timezone,    "city": city,    "ll": List<dynamic>.from(ll!.map((x) => x)),    "metro": metro,    "area": area,  };}